        <div className="weather__content">
            <h2 className="weather__location">{data.name}</h2>
            <p>Wind speed: {data.wind.speed}</p>
            <p>Temperature: {data.main.temp}</p>
            <p>Feels like: {data.main.feels_like}</p>
        </div>
    )
}
